package aca.proyectos;

public class Logro {
	
	private int id;
	private int id_metainst;
	private String fecha_creada;
	private String fecha_final;
	private String descripcion;
	private String indicador;
	private String codigopersonal;
	private String depto;
	private String estado;
	private String comentario;


	public Logro() {
		// TODO Auto-generated constructor stub
	}


	public int getId() {
		return id;
	}


	public void setId(int id) {
		this.id = id;
	}


	public int getId_metainst() {
		return id_metainst;
	}


	public void setId_metainst(int id_metainst) {
		this.id_metainst = id_metainst;
	}


	public String getFecha_creada() {
		return fecha_creada;
	}


	public void setFecha_creada(String fecha_creada) {
		this.fecha_creada = fecha_creada;
	}


	public String getFecha_final() {
		return fecha_final;
	}


	public void setFecha_final(String fecha_final) {
		this.fecha_final = fecha_final;
	}


	public String getDescripcion() {
		return descripcion;
	}


	public void setDescripcion(String descripcion) {
		this.descripcion = descripcion;
	}


	public String getIndicador() {
		return indicador;
	}


	public void setIndicador(String indicador) {
		this.indicador = indicador;
	}


	public String getCodigopersonal() {
		return codigopersonal;
	}


	public void setCodigopersonal(String codigopersonal) {
		this.codigopersonal = codigopersonal;
	}


	public String getDepto() {
		return depto;
	}


	public void setDepto(String depto) {
		this.depto = depto;
	}


	public String getEstado() {
		return estado;
	}


	public void setEstado(String estado) {
		this.estado = estado;
	}


	public String getComentario() {
		return comentario;
	}


	public void setComentario(String comentario) {
		this.comentario = comentario;
	}
	

}


